import React from 'react';

const Experience: React.FC = () => {
  return (
    <section id="experience" className="py-20 text-center">
  <div className="container mx-auto">
    <h2 className="text-3xl font-bold mb-4 text-orange-500">Professional Experience</h2>
    <ul className="flex justify-center space-x-8">
      <li className="flex-1 mb-4">
        <strong>Implementation d’un SOC et Penetests </strong> Stage d’ingénieur au Centre National de Recherche Scientifique et Technique à Rabat, Maroc
      </li>
      <li className="flex-1 mb-4">
        <strong>Simulation d’une communication des antennes MIMO à </strong> l'École Mohammadia d'Ingénieurs.
      </li>
    </ul>
  </div>
</section>
  );
};

export default Experience;
